const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const open = (id) => {
    setOpenTooltip(id);
  };

  const close = () => {
    setOpenTooltip(null);
  };

