          <div className="tooltip-content">This is a tooltip</div>
          <button onClick={close}>Close</button>
        </div>
      )}
    </>
  );
};

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip id="1">Hover over me</Tooltip>
        <Tooltip id="2">Click me</Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
